import { BrowserRouter as Router, Route } from "react-router-dom";
import UserProvider from "./context";
import AppView from "./components/AppView";

function App() {
  return (
    <Router>
      <UserProvider>
        <Route path="/" exact>
          <AppView />
        </Route>
      </UserProvider>
    </Router>
  );
}

export default App;
